import React, { Component } from 'react';

const PersonalCard = props => {
        return (
            <div>
                <h1>{props.firstName}, {this.props.lastName}</h1>
                <p>Age: {props.age}</p>
                <p>Hair Color: {this.props.hairColor}</p>
            </div>
        );
}
export default PersonalCard;
